<g id="Invertebrate_facts">
	<text transform="matrix(1 0 0 1 24.3481 78.0923)"><tspan x="0" y="0" class="st1 st2 st3">Invertebrate </tspan><tspan x="316.06" y="0" class="st1 st4 st3">facts</tspan></text>
</g>
<g id="Tiny_animals_without_backbones_f_00000011000456304719560070000007812203701909385889_">
	<rect x="28.6" y="111.73" class="st5" width="347.5" height="120.5"/>
	<text id="Tiny_animals_without_backbones_f" transform="matrix(1 0 0 1 28.6001 121.6724)"><tspan x="0" y="0" class="st1 st4 st6">Tiny animals without backbones frst appeared </tspan><tspan x="0" y="18.49" class="st1 st4 st6">more than 600 million years ago. These early </tspan><tspan x="0" y="36.99" class="st1 st4 st6">invertebrates lived in water, and many still do. </tspan><tspan x="0" y="55.48" class="st1 st4 st6">Today, the diversity of invertebrates found </tspan><tspan x="0" y="73.98" class="st1 st4 st6">throughout the world is staggering, from </tspan><tspan x="0" y="92.47" class="st1 st4 st6">squids and starfsh to worms and spiders. </tspan></text>
</g>
<g id="INVERTEBRATE_TYPES">
	<text transform="matrix(1 0 0 1 28.4888 273.6479)"><tspan x="0" y="0" class="st1 st7 st8">INVERTEBRATE </tspan><tspan x="178.64" y="0" class="st1 st9 st8">TYPES</tspan></text>
</g>
<g id="There_are_around_35_main_groups_00000153702626655815721440000003652359941203253170_">
	<rect x="28.49" y="280.48" class="st5" width="306.5" height="64.5"/>
	<text id="There_are_around_35_main_groups" transform="matrix(1 0 0 1 28.4888 287.583)"><tspan x="0" y="0" class="st1 st10 st11">There are around 35 main groups of species in the animal </tspan><tspan x="0" y="11" class="st1 st10 st11">kingdom. Just one of these groups, the vertebrates, contains all </tspan><tspan x="0" y="22" class="st1 st10 st11">the fsh, amphibians, reptiles, birds, and mammals. The other 34 </tspan><tspan x="0" y="33" class="st1 st10 st11">groups are invertebrates – animals without an internal, jointed </tspan><tspan x="0" y="44" class="st1 st10 st11">skeleton. Six of the main invertebrate groups are shown here. </tspan></text>
</g>
<g id="EXTREME_HABITATS">
	<text transform="matrix(1 0 0 1 374.8809 561.9922)"><tspan x="0" y="0" class="st1 st9 st8">EXTREME</tspan><tspan x="109" y="0" class="st1 st12 st8"> HABITATS</tspan></text>
</g>
<g id="Some_invertebrates_can_withstand_00000180328233234202909390000012369661709503650692_">
	<rect x="374.88" y="568.83" class="st5" width="318" height="42.5"/>
	<text id="Some_invertebrates_can_withstand" transform="matrix(1 0 0 1 374.8818 575.9258)"><tspan x="0" y="0" class="st1 st10 st11">Some invertebrates can withstand – and even thrive – in incredibly </tspan><tspan x="0" y="11" class="st1 st10 st11">hostile conditions, from barren, icy Antarctica to vast, unexplored </tspan><tspan x="0" y="22" class="st1 st10 st11">regions thousands of metres below the ocean’s surface. </tspan></text>
</g>

</g>
